- proto: PaperWritten
  entities:
  - uid: 30
    components:
    - type: Transform
      pos: -4.4310584,3.6074145
      parent: 1
    - type: Paper
      content: >-
        Они просто стоят. Неподвижные силуэты в полумраке. Головы склонены.


        Но стоит лишь на мгновение отвести взгляд... И вот они уже ближе. Поза та же, только расстояние изменилось.


        Их лица скрыты падающими прядями, но ты чувствуешь взгляд. Тяжёлый, немигающий. А по щекам струится влага — не вода, а что-то холодное и древнее. То, что выжимает сама Вечность.


        Не моргай. Эта влага — не слезы печали. Это признак того, что они уже питаются. Питаются твоим временем, твоим будущим, оставляя тебе лишь окаменевшее прошлое.


        И помни главное: всё, что примет их образ... само станет одним из них.
